// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';

var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");

function decode(json) {
  return {
          communityId: Json_decode.field("communityId", Json_decode.string, json),
          courseId: Json_decode.field("courseId", Json_decode.string, json)
        };
}

function communityId(t) {
  return t.communityId;
}

function courseId(t) {
  return t.courseId;
}

function create(communityId, courseId) {
  return {
          communityId: communityId,
          courseId: courseId
        };
}

exports.decode = decode;
exports.communityId = communityId;
exports.courseId = courseId;
exports.create = create;
/* No side effect */
